Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(1,'New York',1,1,1,8468000,'Nueva York incluye 5 distritos que se ubican donde el río Hudson desemboca en el océano Atlántico.');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(2,'Los Angeles',1,1,4,3849000,'Los Ángeles es una ciudad en rápido crecimiento del Sur de California y es el núcleo de la industria televisiva y cinematográfica del país.');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(3,'Madrid',3,1,3,3223000,'Madrid es un municipio y una ciudad de España. La localidad, con categoría histórica de villa, ​ es la capital del Estado​ y de la Comunidad de Madrid');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(4,'Marsella',4,1,3,861350,'Marsella, una ciudad puerto del sur de Francia, ha sido una intersección de inmigración y comercio desde que los griegos la fundaron alrededor del año 600 a. C. ');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(5,'Roma',12,1,3,2837000,'Roma, la capital de Italia, es una extensa ciudad cosmopolita que tiene a la vista casi 3,000 años de arte, arquitectura y cultura de influencia mundial.');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(6,'Rio de Janeiro',2,3,4,6748000,'Río de Janeiro es una enorme ciudad costera de Brasil, famosa por sus playas de Copacabana e Ipanema,');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(7,'Acapulco',7,3,4,779000,'Acapulco, un balneario en la costa del Pacífico de México, se ubica en una gran bahía bordeado de edificios de muchos pisos y las montañas');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(8,'Viña del Mar',6,3,3,326000,'Viña del Mar es una ciudad turística costera al noroeste de Santiago de Chile. Es conocida por sus jardines, playas y altos edificios.');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(9,'Dubai',8,4,4,3331000,'Dubái es una ciudad emirato de los Emiratos Árabes Unidos conocida por su lujoso comercio, la arquitectura ultramoderna y su vida nocturna animada');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(10,'Atacama',6,4,4,300000,'La Región de Atacama​​​ es una de las dieciséis regiones en que se divide Chile. Es la puerta de entrada al Norte chico del país. Su capital es Copiapó');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(11,'El Cairo',9,4,4,9540000,'El Cairo, la extensa capital de Egipto, se ubica en el río Nilo. En su centro, se encuentra la plaza Tahrir y el vasto Museo Egipcio,');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(12,'Zurich',10,2,1,402780,'La ciudad de Zúrich, un centro bancario y financiero global, se encuentra al norte del lago de Zúrich en el norte de Suiza.');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(13,'Zagreb',13,2,1,806340,'agreb, la capital de Croacia en el noroeste, se caracteriza por su arquitectura austrohúngara de los siglos XVIII y XIX. En su centro, en Upper Town');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(14,'Paris',4,2,3,2161000,'París, la capital de Francia, es una importante ciudad europea y un centro mundial del arte, la moda, la gastronomía y la cultura');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(15,'Pucón',6,5,5,22000,'Pucón ​​ es una comuna de la Provincia de Cautín, perteneciente a la Región de Araucanía, situada en la zona sur de Chile.');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(16,'Amsterdam',11,5,5,821000,'Amsterdam es la capital de los Países Bajos, conocida por su patrimonio artístico, su elaborado sistema de canales y sus casas angostas');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(17,'Hanói',5,5,5,8242000,'Hanói, la capital de Vietnam, es conocida por su arquitectura de siglos de antigüedad y su rica cultura con influencias de Francia, China y el Sudeste Asiático');
Insert into Lugares(L_ID,L_NOMBRE,L_N_ID,L_T_ID,L_C_ID,L_POBLACION,L_DESCRIPCION) VALUES(18,'La Habana',14,5,3,2130000,'a Habana es la capital de Cuba. La arquitectura colonial española en el centro de la Habana Vieja del siglo XVI incluye el Castillo de la Fuerza Real,');
